import { async } from '@firebase/util';
import React, { useState } from 'react';
import { useAuth, logout} from '../firebase';
import Header from './Header';
import { useRef } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Account() {
    const navigate = useNavigate();
    const currentUser = useAuth();
    const [ loading, setLoading ] = useState(false);
    

     async function handleLogout() {
        setLoading(false);
        try {
            await logout();
            navigate("/")
        } catch {
           alert("mislukt!") 
        }
        setLoading(true);
    }

    return(
        <div>
            <Header/>

            <div className=''></div>

            {currentUser && <button disabled={loading || !currentUser} onClick={handleLogout} className='px-3 py-1 bg-gray-800 text-white text-sm font-semibold rounded'>Log uit</button>}

            <div class=" flex flex-col justify-center py-12 sm:px-6 lg:px-8"></div>

            <div class="max-w-md mx-auto bg-white rounded-xl overflow-hidden md:max-w-2xl">
            <div class="md:flex">
                <div class="md:flex-shrink-0">
                </div>
                <div class="p-8">
                <div class="uppercase tracking-wide text-sm text-indigo-500 font-semibold">Account</div>
                <a href="#" class="block mt-1 text-lg leading-tight font-medium text-black hover:underline">John Doe</a>
                <p class="mt-2 text-gray-500">{currentUser?.email}</p>
                <p class="mt-2 text-gray-500">Member since January 2022</p>
                </div>
            </div>
            </div>

        </div>
    )
}
